import React from "react";
import "../css/Footer.css";

const Footer: React.FC = () => {
    return (
        <footer>
            <div className="footer">
                <div className="link-social">
                    <a href="https://github.com/HigoJhon">
                        <img width="70" src="data:image/png;base64," alt="" />
                    </a>
                    <a href="https://www.linkedin.com/in/higo-jhon/">
                        <img width="55" src="data:image/png;base64," alt="" />
                    </a>
                </div>
                <div className="email">
                    <p><i className="bi bi-envelope-fill"></i> <a href="mailto:higojhon98@gmail.com">higojhon98@gmail.com</a></p>
                </div>
            </div>
        </footer>
    );
};

export default Footer;
